import React, { Component } from 'react';
import { useParams } from 'react-router-dom';

class Name extends Component {
  render() {
    const { userHandle } = useParams();
    return (
      <Container>
        {`user: ${userHandle}`}
      </Container>
    )
  }
}

export default Name;
